window.bookSummaryJSON = "<p><b>A mysterious signal, A start-up that wants to change the world, A future that no longer belongs to us.</b></p> <p>When a stranger with a high-tech implant is found in the remote Finnish wilderness, neurosurgeon Bill and his computer scientist friend Steve see an opportunity. But they don't know what powers they're up against. They soon must ask themselves what moral boundaries they're willing to cross in order to succeed.</p> <p>Ten years later, the world has changed. Airships roam the skies, strange plants grow in the forests, and entire swaths of land are deserted.</p> <p>In the midst of this alien world, a father and daughter struggle to survive in the mountains of Montana and avoid being discovered by \"The Others.\" One thing is clear: humanity’s future depends upon deciphering the mysterious signal.</p>"; 
